sive moments with ease. It’s capable of shooting continuous bursts at up to 120 fps* with AF/AE tracking, all without viewfinder blackout, and its highly-advanced AI processing unit recognises subjects with astonishingly high precision and reliability. \n\n*1 Compared to interchangeable-lens digital cameras. As of the November 2023 product announcement. Sony survey.\n*2 Approximate, effective.\n*3 Sony test conditions. Maximum continuous frame rate may be lower in some shooting conditions. Continuous shooting speed may vary depending on the lens used in AF-C focus modes. Visit Sony’s support web page for lens compatibility information.\n\n#Sony #SonyAlpha #Alpha #Alpha9III #Alpha9\nSubscribe: http://bit.ly/SonyCameraChannel\n\nAbout Sony:\nAt Sony, our mission is to be a company that inspires and fulfils your curiosity. Our unlimited passion for technology, content and services, and relentless pursuit of innovation, drives us to deliver ground-breaking new excitement and entertainment in ways that only Sony can, creating unique new cultures and experiences. Everything we do is to move you emotionally.\n\nWEBSITE: https://www.sony.co.uk/electronics/in...\n\nSony Camera Channel\n   / imagingbysony  ","commandRuns":[{"startIndex":1008,"length":5,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCwQ3NcEGBQiEwi-kN2HqYiFAxV6YkECHYxIBbU=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/sony","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUICgRzb255GAE%3D"}}},"loggingDirectives":{"trackingParams":"CCwQ3NcEGBQiEwi-kN2HqYiFAxV6YkECHYxIBbU=","enableDisplayloggerExperiment":true}},{"startIndex":1014,"length":10,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCsQ3NcEGBUiEwi-kN2HqYiFAxV6YkECHYxIBbU=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/sonyalpha","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browse
